import React from 'react'; // Import the Component component from React
import {Link} from 'react-router-dom'; // Import the Link component
import '../css/App.css';
import ReactPlayer from 'react-player'

const portfolioVideo = require("./../content/portfolio.mp4")
const image = require("./../content/embla/hero-image.png")

function Home(props) {
  return (
    <div>
      <div className="highlight-reel">
        <ReactPlayer
         className='react-player'
         url={portfolioVideo}
         playing
         volume={10}
         muted
         loop
         height="auto"
         width='100%'
        />
      </div>
    </div>
  );
}

export default Home;
